import React, {Component} from 'react'

class Navbar extends Component {
	render() {
		return (
			<div>
				<div>Logo</div>

				<ul>
					<li>Home</li>
					<li>Task</li>
					<li>Logout</li>
				</ul>
			</div>
		);
	}
}

export default Navbar;
